import React from 'react';

export default function SearchInput() {
    return (
        <div className="search-input">
            <div className="search-text">Search</div>
            <img src="https://cdn.builder.io/api/v1/image/assets/TEMP/56eb7dcc959d6dade13154f6e8138a496ea32decaad5ca98e4d0c1a0e922c929?apiKey=dab1d767c7fa4022a44c79fa035746a8&" alt="" className="search-icon" />
        </div>
    );
}
